import './index.css';
import Navbar from "./components/Navbar";

function App() {
  return (
  <div className="App">
    <Routes>
      <Route path ="/" element = {<home/>}/>
      <Route path ="/about" element = {<about/>}/>
      <Route path ="/ground" element = {<grounds/>}/>
      <Route path ="/login" element = {<login/>}/>
    </Routes>
    <Navbar/>
  </div>
  )}
  export default App
